import Dbal from "./Dbal";

export default class DaoUtilisateur {
    /**
     * Singleton
     * @returns {DaoUtilisateur|DaoUtilisateur}
     */
    constructor() {
        if (!!DaoUtilisateur.instance) {
            return DaoUtilisateur.instance;
        }
        /**@type {DaoUtilisateur}**/
        DaoUtilisateur.instance = this;
        /**@type {Dbal}**/
        this.dbal = new Dbal();
        return this;
    }
}
